import React ,{useEffect}from 'react';

import { Jumbotron } from 'reactstrap';

const About=()=>{

    useEffect( () => {
        document.title="About";
    },[]);
    

    return (
        <div>
            <Jumbotron>
                <ul>
                    <li>This is my First ReactJs webApplication</li>
                    <li></li>

                </ul>
                <p className="text-weight"><b></b></p>

            </Jumbotron>
        </div>
    )
};

export default About;
